package day8;

public class ArraysEx3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// In Java Arrays are objects
		
		int[] arr = {5,2,7,9,3};
		
		
		System.out.println("Elements are: ");
		// Enhance For Loop
		for(int ele : arr) {
			System.out.print(ele+" ");
		}

	}

}
